import React from 'react';

import { Card, CardHeader, CardBody, CardFooter } from "react-simple-card";

const card = () => {
    <Card>
        <CardHeader>Header</CardHeader>
        <CardBody>Body</CardBody>
        <CardFooter>Footer</CardFooter>
    </Card>
};

export default card;
